import { Button } from '@mui/material'
import React from 'react'

const CustomButton = (props) => {
    const styles = {
        height: 40, width: 130, borderRadius: 2, backgroundColor: '#2148C0',
    }
    return (
        <Button
            size="small"
            variant="contained"
            sx={{ styles }}
            onClick={props.onClick}>
            {props.icon}
            {props.text}
        </Button>
    )
}

export default CustomButton
